import React from 'react';
import './Slider.css';

function Slider({ images }) {

    return (
        <div className='slider'>
            <div className='slider__wrapper'></div>
            {images.map((image, index) => {
                return <div key={index}>{image.image}</div>
            })}
        </div>
    );
}

export default Slider
